import { Box, HStack, Input, List, ListItem } from "@chakra-ui/react";
import React, { useEffect, useState } from "react";
import axios from "axios";

function App() {
  const [posts, setPosts] = useState([]);
  const [selectedId, setSelectedId] = useState("");
  const [resposta, setResposta] = useState(0);
  const [allAnswers, setAllAnswers] = useState("");
  console.log(allAnswers)

  useEffect(() => {
    if (selectedId) {
      fetchQuestions(selectedId);
    }
  }, [selectedId]);

  const fetchQuestions = async (id) => {
    try {
      const response = await axios.get(`http://localhost:8005/perguntas/${id}`);
      const questionList = response.data.map(post => post.selectedQuestions.map(question => question.pergunta));
      setPosts(questionList.flat()); // Flatten nested arrays if necessary
    } catch (error) {
      // Handle errors here (e.g., display an error message)
      console.error("Error fetching questions:", error);
    }
  };

  const handleIdChange = (event) => {
    setSelectedId(event.target.value);
  };

  const handleAnswerChange = (questionIndex, answer) => {
    const answersArray = [...posts]; // Create a copy of the posts array
    answersArray[questionIndex] = answer; // Update the answer for the specific question
    setAllAnswers(answersArray.join("\n")); // Concatenate answers with newlines
  };



  async function handleSubmit() {
 
    const response = resposta
  try{
    await axios.post('http://localhost:8005/response', {  
      resposta:response,
    });
      console.log('Respostas salvas com sucesso!');
 
    } catch (error) {
      console.error(error);
    }
  }


  return (
    <div>
      <HStack spacing={8}>
        <Box w="100%" ml="5%" mt="5%">
          <Input
            className="wrap-input"
            id="cpfInput"
            value={selectedId}
            onChange={handleIdChange}
            placeholder="Enter _id to fetch data"
          />
        </Box>
      </HStack>

      {posts.length > 0 ? (
        <List spacing={3}>
          {posts.map((question, index) => (
            <ListItem key={index}>{question}<br></br>
             <input
                className="space"
                type="text"
                placeholder="Digite sua resposta..."
                onChange={e => handleAnswerChange(index, e.target.value)}
              />
            </ListItem>
          ))}
          <button onClick={handleSubmit} >Enviar</button>
        </List>
      ) : (
      
        <Box textAlign="center">Loading...</Box>
      )}
    </div>
  );
}

export default App;





